) S where NOT EXISTS ( select 1 from <?=snpRef.getObjectName("L", "DT_ACTIVITY", "DT_TCL", "", "D") ?> T where T.ID = S.ID and ((T.ID_FLOW = S.ID_FLOW) or (T.ID_FLOW IS NULL and S.ID_FLOW IS NULL)) and ((T.NAME = S.NAME) or (T.NAME IS NULL and S.NAME IS NULL)) and ((T.ALIAS = S.ALIAS) or (T.ALIAS IS NULL and S.ALIAS IS NULL)) and ((T.ACTIVITY_MODULE = S.ACTIVITY_MODULE) or (T.ACTIVITY_MODULE IS NULL and S.ACTIVITY_MODULE IS NULL)) and ((T.ROOT_ACTIVITY_MODULE = S.ROOT_ACTIVITY_MODULE) or (T.ROOT_ACTIVITY_MODULE IS NULL and S.ROOT_ACTIVITY_MODULE IS NULL)) and ((T.FK_PROCESS_FLOW = S.FK_PROCESS_FLOW) or (T.FK_PROCESS_FLOW IS NULL and S.FK_PROCESS_FLOW IS NULL)) and ((T.TYPE = S.TYPE) or (T.TYPE IS NULL and S.TYPE IS NULL)) and ((T.MODEL_CODE = S.MODEL_CODE) or (T.MODEL_CODE IS NULL and S.MODEL_CODE IS NULL)) and ((T.FK_TABLE = S.FK_TABLE) or (T.FK_TABLE IS NULL and S.FK_TABLE IS NULL)) and ((T.FK_MAPPING = S.FK_MAPPING) or (T.FK_MAPPING IS NULL and S.FK_MAPPING IS NULL)) )

